import React, { useState, useEffect } from 'react';
// import './data.css';

function Data() {

    const [isData, setData] = useState([])

    useEffect(() => {
        fetch('/api').then(
            res => res.json()
        ).then(data => setData(data))
    }, [])

    var test = isData.headerMLB

    return (
        <div className="App">
            {console.log(test)}
            {console.log("TEST", typeof (test))}
        </div>
    );
}

export default Data;
